import "./App.css";
import {BrowserRouter, Routes, Route} from 'react-router-dom';
import Home from './pages/Home';
import Diary from './pages/Diary';
import New from './pages/New';
import Edit from './pages/Edit';

function App(){
    return(
        <BrowserRouter>
            <div className="App">
                <h2>app.js</h2>
                <Routes>
                    <Route path="/" element={<Home />} />
                </Routes>
            </div>
        </BrowserRouter>
    );
};

export default App;
